pub fn glyph(c: char) -> &'static SerifGlyph {
    let idx = c as usize;
    if (32..=126).contains(&idx) {
        &GLYPHS[idx - 32]
    } else {
        &GLYPHS[(b'?' - 32) as usize]
    }
}
